  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Tewaukon
  WMD outlines Refuge accomplishments during the 1984 calendar year. The report begins
  with a summary of the year's highlights and weather conditions. Land acquisition
  is covered. The report includes a planning section which discusses management planning.
  Refuge administration is outlined; information about personnel, youth programs,
  volunteer programs, funding, and safety is given. Habitat management is also covered;
  subjects include wetlands, forests, croplands, grasslands, grazing, haying, fire
  management, pest control, and WPA easements. The wildlife section of the report
  discusses wildlife diversity, endangered and threatened species, waterfowl, raptors,
  and game mammals. The public uses of the Refuge described in this report include
  interpretive programs, hunting, trapping, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, equipment replacement, and energy conservation. Cooperative
  programs and items of interest are provided at the end.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
